　毛糸をぐるぐる巻いて作るふかふかマスコット「動物ぽんぽん」のつくり方集<br>
<br>
■trikotri(黒田 翼) 著<br>
1981年、静岡県生まれ。東京藝術大学絵画科卒業。<br>
こどもの頃から絵を描くことや、ものづくりに親しむ。<br>
手芸店にて在勤中、ワークショップの講師や店頭の見本づくりを担当し、<br>
当時作っていたポンポンの作品から着想を得て、2014年に「森の動物たちのぽんぽんプローチを」制作。<br>
「第一回ハンドメイド大賞」にて、大賞およびアクセサリー部門賞受賞。<br>
毛糸や羊毛の素材に魅了され、アクセサリーや小物を制作している。<br>
<br>
■127ページ<br>
■21x18x1cm<br>
■誠文堂新光社<br>
■ISBN 9784416516836<br>
