　くみひもって、かわいい!<br><br>「くみひも」というと、和装や和雑貨に使われるイメージが強いかもしれません。<br>でも本当は、日常のさまざまな場面で使うことができるのです。<br>そんなくみひもの使い方を、たっぷり75案ご紹介!<br><br>工場見学や、「くみひも」を取り扱うおしゃれなショップへのインタビューなど、くみひもをより深く知ることができるページも。<br>くみひもだからこそ! のかわいさを、感じていただけたら幸いです。<br><br>出版社 マガジンランド<br>サイズ 21×14.8×1.6cm<br>ページ数 112ページ <br><br><img src="https://image.rakuten.co.jp/tukurutanosimi/cabinet/mail_ok.jpg" /><style type="text/css">
