　組ひもとは、日本伝統の工芸品で細い絹糸や綿糸を組んで仕上げるひものこと。<br>帯締めや根付に使用されているところを目にしている人が多いかもしれません。<br><br>組ひもと聞くと和のイメージを抱きやすいですが、本来の使い方以外にも<br>キーホルダー、アクセサリー、インテリア小物などに広く活用することができます。<br>そして嬉しいことに、組ひもは誰でもかんたんに作ることができるのです。<br><br>道具は中央に穴の開いた「丸台」のほかに、「組ひもディスク」「組ひもプレート」と糸だけ。<br>穴が開いていればスツールでもお風呂の椅子でもいいのです。<br><br>この本ではこれら3種の道具を使い、やさしい組み方から応用まで、50通りの組み方を紹介します。<br>すべての組み方に手筈の図解が入っているので、はじめて挑戦する人でもぜったいに組むことができ、<br>またうまく組めないときの解決法や組み方を忘れてしまった時の思い出し方なども掲載しています。<br><br>そして、3人の手づくり作家による組ひもを使ったアクセサリーのレシピも掲載。<br>ネックレス、ブレスレット、ヘッドアクセサリーなど、華奢でかわいい作品が並びます。<br><br>組ひもを知っていた人も知らなかった人も、組ひもの新たな魅力を発見できるはず。<br>色づかいのアレンジや組み目の美しさを楽しみながら、自分なりの組ひもづくりに挑戦してみてください。<br><br>出版社 誠文堂新光社<br>サイズ 22.8×18×1.8cm<br>ページ数 160ページ <br><br><img src="https://image.rakuten.co.jp/tukurutanosimi/cabinet/mail_ok.jpg" /><style type="text/css">
