　好評だった「着まわしが楽しいワンピースとチュニック」の第2弾。<br />よりコーディネートを楽しめるようにパンツとバッグも加えて、すっきり見えて、着まわせるワンピースとチュニックをお届けします。<br />普段からちょっとしたおでかけまでコーディネートしやすいアイテムとコーディネート例と合わせて紹介。<br />ワンピース、チュニック、ブラウス、ベスト、ガウン、など全25作品を作り方付きで紹介。<br />うち2点は写真で作り方を詳しく掲載しています。<br />サイズはS・M・L・LLの4サイズ。<br />現役デザイナーによるラインのきれいなパターンです。<br />実物大型紙付き。<br /><br />
